import React from 'react';
import InputBar from './inputBar';

const InputField = ({getIMG, submitImage}) => {
	return (
		<div className='inputfield'>
			<InputBar getIMG={getIMG} submitImage = {submitImage}/>

		</div>
		)
}

export default InputField;
